function instance_manager_load(link, result, timeout) {
  (function ($) {
    $.ajax({
      type: 'GET',
      dataType: 'html',
      url: link.href,
      timeout: 20000,
      success: function(data, textStatus){
        result.html(data);

        // if the returned div includes a failed class, then reload it after a timeout
        if(result.children(":first").hasClass("failed")) {
          setTimeout(function() {instance_manager_load(link, result, timeout)}, timeout);
        };
      },
      error: function(xhr, textStatus, errorThrown){
        if(textStatus == 'timeout')
          result.html('<h3 class="error">The server is not responding in a timely fashion</h3>');
        else
          result.html('<h3 class="error">Permission denied</h3>');
      }
    });
  })(jQuery);
}

(function ($) {
  $(document).ready(function() {
    $("div.instance_manager div.label a").bind('click',function(event){
      event.preventDefault();
      var result = $(this).parent().next("div.instance_manager div.tryit.callout");
      result.slideDown();
      // try every 15 seconds for an available machine
      instance_manager_load(this, result, 15000);
    })
  });
})(jQuery);
